import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const PackageContact = ({ heading }) => {
    return (
        <View>
            <Text style={styles.contactHeading}>{heading}</Text>
            <View style={styles.c_Box}>
                <View style={styles.c_flex}>
                    <View style={styles.flex_one}></View>
                    <View style={styles.flex_two}></View>
                </View>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    contactHeading: {
        padding: '10px',
        color: "#102C56",
        fontWeight: '600',
        fontSize: '22px',
        lineHeight: "24px",
        letterSpacing: '2%'
    },
    c_Box: {
        height: '100px',
        width: '100vw',
        backgroundColor: "orange",
    },
    c_flex: {
        width: '98vw',
        height: '90px',
        backgroundColor: "#fff",
        margin: 'auto',
        flexDirection:'row',
        justifyContent:'s'
    },
    flex_one: {
        width: '45vw',
        height: '10px',
        backgroundColor: "#909090"
    },
    flex_two: {
        width: '60vw',
        height:'10px',
        backgroundColor:"#606060"
    }
})

export default PackageContact;
